import React, { useState } from 'react';
import telephoneImage from './assets/telephone.png';
import autreImage from './assets/telephone2.png'; // optionnel
import Image from './components/Image';

function App() {
  const [image, setImage] = useState(telephoneImage);

  const changerImage = () => {
    setImage(prev => prev === telephoneImage ? autreImage : telephoneImage);
  };

  return (
    <div className="App">
      <Image image={image} />
      <button onClick={changerImage}>Changer l'image</button>
    </div>
  );
}

export default App;
